043e\u0435 \u043a\u043d\u044f\u0436\u0435\u0441\u0442\u0432\u043e \u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u043e\u0435\">\u041c\u043e\u0441\u043a\u0432\u043e\u0439<\/a> .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1698_%D0%B3%D0%BE%D0%B4\" title=\"1698 \u0433\u043e\u0434\">1698<\/a>&#160;\u2014 \u0421\u043f\u0443\u0441\u0442\u044f \u0448\u0435\u0441\u0442\u044c \u0434\u043d\u0435\u0439 \u043f\u043e\u0441\u043b\u0435 \u0442\u043e\u0433\u043e, \u043a\u0430\u043a \u0446\u0430\u0440\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%91%D1%82%D1%80_I\" title=\"\u041f\u0451\u0442\u0440 I\">\u041f\u0451\u0442\u0440 I<\/a> \u0441\u043e\u0431\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0440\u0443\u0447\u043d\u043e \u043e\u0431\u0440\u0435\u0437\u0430\u043b \u0431\u043e\u0440\u043e\u0434\u044b \u0441\u0432\u043e\u0438\u043c \u0432\u0435\u043b\u044c\u043c\u043e\u0436\u0430\u043c, \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0441\u044f \u0431\u043e\u043b\u044c\u0448\u043e\u0439 \u043e\u0431\u0435\u0434 \u0443 \u0431\u043e\u044f\u0440\u0438\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B5%D0%B8%D0%BD,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B5%D0%B9_%D0%A1%D0%B5%D0%BC%D1%91%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0428\u0435\u0438\u043d, \u0410\u043b\u0435\u043a\u0441\u0435\u0439 \u0421\u0435\u043c\u0451\u043d\u043e\u0432\u0438\u0447\">\u0410\u043b\u0435\u043a\u0441\u0435\u044f \u0421\u0435\u043c\u0451\u043d\u043e\u0432\u0438\u0447\u0430 \u0428\u0435\u0438\u043d\u0430<\/a> \u043f\u043e \u0441\u043b\u0443\u0447\u0430\u044e \u0442\u043e\u0433\u0434\u0430\u0448\u043d\u0435\u0433\u043e \u041d\u043e\u0432\u043e\u0433\u043e \u0433\u043e\u0434\u0430. \u041d\u0435\u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0438\u0437 \u043d\u0435\u0434\u043e\u0433\u0430\u0434\u043b\u0438\u0432\u044b\u0445 \u0433\u043e\u0441\u0442\u0435\u0439 \u044f\u0432\u0438\u043b\u0438\u0441\u044c \u0441 \u0431\u043e\u0440\u043e\u0434\u0430\u043c\u0438, \u043d\u043e \u0442\u0435\u043f\u0435\u0440\u044c \u0432 \u043e\u0431\u0440\u0435\u0437\u0430\u043d\u0438\u0438 \u0431\u043e\u0440\u043e\u0434 \u0443\u043f\u0440\u0430\u0436\u043d\u044f\u043b\u0441\u044f \u0446\u0430\u0440\u0441\u043a\u0438\u0439 \u0448\u0443\u0442. \u041a\u0442\u043e \u043f\u043e\u0441\u043b\u0435 \u044d\u0442\u043e\u0433\u043e \u043d\u0435 \u0445\u043e\u0442\u0435\u043b \u0431\u0440\u0438\u0442\u044c\u0441\u044f, \u0434\u043e\u043b\u0436\u0435\u043d \u0431\u044b\u043b \u043f\u043b\u0430\u0442\u0438\u0442\u044c \u043f\u043e\u0448\u043b\u0438\u043d\u0443 \u0437\u0430 \u043f\u0440\u0430\u0432\u043e \u043d\u0430 \u0431\u043e\u0440\u043e\u0434\u0443.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1741_%D0%B3%D0%BE%D0%B4\" title=\"1741 \u0433\u043e\u0434\">1741<\/a>&#160;\u2014 \u041f\u043e\u0441\u043b\u0435 23 \u0434\u043d\u0435\u0439 \u0431\u0435\u0441\u043f\u0440\u0435\u0440\u044b\u0432\u043d\u043e\u0439 \u0440\u0430\u0431\u043e\u0442\u044b \u043d\u0435\u043c\u0435\u0446\u043a\u0438\u0439 \u043a\u043e\u043c\u043f\u043e\u0437\u0438\u0442\u043e\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BD%D0%B4%D0%B5%D0%BB%D1%8C,_%D0%93%D0%B5%D0%BE%D1%80%D0%B3_%D0%A4%D1%80%D0%B8%D0%B4%D1%80%D0%B8%D1%85\" title=\"\u0413\u0435\u043d\u0434\u0435\u043b\u044c, \u0413\u0435\u043e\u0440\u0433 \u0424\u0440\u0438\u0434\u0440\u0438\u0445\">\u0413. \u0413\u0435\u043d\u0434\u0435\u043b\u044c<\/a> \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u043b \u043e\u0440\u0430\u0442\u043e\u0440\u0438\u044e \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D1%81%D1%81%D0%B8%D1%8F_(%D0%BE%D1%80%D0%B0%D1%82%D0%BE%D1%80%D0%B8%D1%8F)\" title=\"\u041c\u0435\u0441\u0441\u0438\u044f (\u043e\u0440\u0430\u0442\u043e\u0440\u0438\u044f)\">\u041c\u0435\u0441\u0441\u0438\u044f<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1752_%D0%B3%D0%BE%D0%B4\" title=\"1752 \u0433\u043e\u0434\">1752<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B8%D1%82