\u0430\u0442\u0435\u043d\u0442\u043e\u0432\u0430\u043b \u043b\u0435\u043d\u0442\u0443 \u0434\u043b\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B8%D1%88%D1%83%D1%89%D0%B0%D1%8F_%D0%BC%D0%B0%D1%88%D0%B8%D0%BD%D0%BA%D0%B0\" title=\"\u041f\u0438\u0448\u0443\u0449\u0430\u044f \u043c\u0430\u0448\u0438\u043d\u043a\u0430\">\u043f\u0438\u0448\u0443\u0449\u0435\u0439 \u043c\u0430\u0448\u0438\u043d\u043a\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1896_%D0%B3%D0%BE%D0%B4\" title=\"1896 \u0433\u043e\u0434\">1896<\/a>&#160;\u2014 \u041f\u043e \u0438\u043d\u0438\u0446\u0438\u0430\u0442\u0438\u0432\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D1%81%D0%B3%D0%B0%D1%84%D1%82,_%D0%9F%D1%91%D1%82%D1%80_%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u041b\u0435\u0441\u0433\u0430\u0444\u0442, \u041f\u0451\u0442\u0440 \u0424\u0440\u0430\u043d\u0446\u0435\u0432\u0438\u0447\">\u041f\u0435\u0442\u0440\u0430 \u0424\u0440\u0430\u043d\u0446\u0435\u0432\u0438\u0447\u0430 \u041b\u0435\u0441\u0433\u0430\u0444\u0442\u0430<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" class=\"mw-redirect\" title=\"\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u043b\u0438\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3%D1%81%D0%BA%D0%B8%D0%B9_%D0%B3%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D1%83%D0%BD%D0%B8%D0%B2%D0%B5%D1%80%D1%81%D0%B8%D1%82%D0%B5%D1%82_%D1%84%D0%B8%D0%B7%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%BE%D0%B9_%D0%BA%D1%83%D0%BB%D1%8C%D1%82%D1%83%D1%80%D1%8B_%D0%B8%D0%BC%D0%B5%D0%BD%D0%B8_%D0%9F._%D0%A4._%D0%9B%D0%B5%D1%81%D0%B3%D0%B0%D1%84%D1%82%D0%B0\" class=\"mw-redirect\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0441\u043a\u0438\u0439 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \u0444\u0438\u0437\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u044b \u0438\u043c\u0435\u043d\u0438 \u041f. \u0424. \u041b\u0435\u0441\u0433\u0430\u0444\u0442\u0430\">\u041a\u0443\u0440\u0441\u044b \u0432\u043e\u0441\u043f\u0438\u0442\u0430\u0442\u0435\u043b\u044c\u043d\u0438\u0446 \u0438 \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044c\u043d\u0438\u0446 \u0444\u0438\u0437\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0432\u043e\u0441\u043f\u0438\u0442\u0430\u043d\u0438\u044f<\/a> (\u043d\u044b\u043d\u0435 \u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u0444\u0438\u0437\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u044b \u0438\u043c. \u041f.&#160;\u0424.&#160;\u041b\u0435\u0441\u0433\u0430\u0444\u0442\u0430)&#160;\u2014 \u043f\u0440\u043e\u043e\u0431\u0440\u0430\u0437\u0430 \u0441\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u044b\u0445 \u0432\u044b\u0441\u0448\u0438\u0445 \u0443\u0447\u0435\u0431\u043d\u044b\u0445 \u0437\u0430\u0432\u0435\u0434\u0435\u043d\u0438\u0439 \u0444\u0438\u0437\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1896_%D0%B3%D0%BE%D0%B4\" title=\"1896 \u0433\u043e\u0434\">1896<\/a>&#160;\u2014 \u0412 \u0441\u0442\u043e\u043b\u0438\u0446\u0435 \u0420\u043e\u0441\u0441\u0438\u0438 \u043d\u0430\u0447\u0430\u043b\u043e \u0434\u0435\u0439\u0441\u0442\u0432\u043e\u0432\u0430\u0442\u044c \u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0441\u043a\u043e\u0435 \u0442\u0435\u043b\u0435\u0433\u0440\u0430\u0444\u043d\u043e\u0435 \u0430\u0433\u0435\u043d\u0442\u0441\u0442\u0432\u043e, \u0441\u043e\u0437\u0434\u0430\u043d\u043d\u043e\u0435 \u043f\u043e \u0438\u043d\u0438\u0446\u0438\u0430\u0442\u0438\u0432\u0435 \u043c\u0438\u043d\u0438\u0441\u0442\u0435\u0440\u0441\u0442\u0432\u0430 \u0444\u0438\u043d\u0430\u043d\u0441\u043e\u0432, \u043c\u0438\u043d\u0438\u0441\u0442\u0435\u0440\u0441\u0442\u0432\u0430 \u0432\u043d\u0443\u0442\u0440\u0435\u043d\u043d\u0438\u0445 \u0434\u0435\u043b \u0438 \u043c\u0438\u043d\u0438\u0441\u0442\u0435\u0440\u0441\u0442\u0432\u0430 \u0438\u043d\u043e\u0441\u0442\u0440\u0430\u043d\u043d\u044b\u0445 \u0434\u0435\u043b. \u041e\u043d\u043e \u0438\u043c\u0435\u043b\u043e \u0441\u0432\u043e\u0438\u043c \u00ab\u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u0435\u043c \u0441\u043e\u043e\u0431\u0449\u0430\u0442\u044c \u0432\u043d\u0443\u0442\u0440\u0438 \u0418\u043c\u043f\u0435\u0440\u0438\u0438 \u0438 \u0437\u0430 \u0433\u0440\u0430\u043d\u0438\u0446\u0435\u0439 \u043f\u043e\u043b\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0435, \u0444\u0438\u043d\u0430\u043d\u0441\u043e\u0432\u044b\u0435, \u044d\u043a\u043e\u043d\u043e\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u0435, \u0442\u043e\u0440\u0433\u043e\u0432\u044b\u0435 \u0438 \u0434\u0440\u0443\u0433\u0438\u0435 \u0438\u043c\u0435\u044e\u0449\u0438\u0435 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0438\u043d\u0442\u0435\u0440\u0435\u0441 \u0441\u0432\u0435\u0434\u0435\u043d\u0438\u044f\u2026\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1906_%D0%B3%D0%BE%D0%B4\" title=\"1906 \u0433\u043e\u0434\">1906<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D0%BB%D1%8C%D0%BD%D1%8E%D1%81\" title=\"\u0412\u0438\u043b\u044c\u043d\u044e\u0441\">\u0412\u0438\u043b\u044c\u043d\u0435<\/a> \u0432\u044b\u0448\u043b\u0430 \u043f\u0435\u0440\u0432\u0430\u044f \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u043e \u0440\u0430\u0437\u0440\u0435\u0448\u0435\u043d\u043d\u0430\u044f \u0431\u0435\u043b\u043e\u0440\u0443\u0441\u0441\u043a\u0430\u044f \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e-\u043f\u043e\u043b\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0433\u0430\u0437\u0435\u0442\u0430 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D1%88%D0%B0_%D0%B4%D0%BE%D0%BB%D1%8F\" title=\"\u041d\u0430\u0448\u0430 \u0434\u043e\u043b\u044f\">\u041d\u0430\u0448\u0430 \u0434\u043e\u043b\u044f<\/a>\u00bb. \u041f\u043e \u0441\u0443\u0434\u0435\u0431\u043d\u043e\u043c\u0443 \u043f\u0440\u0438\u0433\u043e\u0432\u043e\u0440\u0443 11 \u044f\u043d\u0432\u0430\u0440\u044f 1907 \u0433\u043e\u0434\u0430 \u0433\u0430\u0437\u0435\u0442\u0430 \u0431\u044b\u043b\u0430 \u0437\u0430\u043f\u0440\u0435\u0449\u0435\u043d\u0430, \u0430 \u0435\u0451 \u0440\u0435\u0434\u0430\u043a\u0442\u043e\u0440 \u043f\u0440\u0438\u0433\u043e\u0432\u043e\u0440\u0451\u043d \u043a \u0442\u044e\u0440\u0435\u043c\u043d\u043e\u043c\u0443 \u0437\u0430\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u044e \u0441\u0440\u043e\u043a\u043e\u043c \u043d\u0430 \u0433\u043e\u0434.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1911_%D0%B3%D0%BE%D0%B4\" title=\"1911 \u0433\u043e\u0434\">1911<\/a>&#160;\u2014 \u0412\u043e \u0432\u0440\u0435\u043c\u044f \u043c\u0435\u043c\u043e\u0440\u0438\u0430\u043b\u044c\u043d\u044b\u0445 \u0442\u043e\u0440\u0436\u0435\u0441\u0442\u0432 \u0432 \u043f\u0430\u043c\u044f\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_II\" title=\"\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 II\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 II<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D0%B5%D0%B2\" title=\"\u041a\u0438\u0435\u0432\">\u041a\u0438\u0435\u0432\u0435<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D1%82%D0%B8%D1%8F_%D1%81%D0%BE%D1%86%D0%B8%D0%B0%D0%BB%D0%B8%D1%81%D1%82%D0%BE%D0%B2-%D1%80%D0%B5%D0%B2%D0%BE%D0%BB%D1%8E%D1%86%D0%B8%D0%BE%D0%BD%D0%B5%D1%80%D0%BE%D0%B2\" title=\"\u041f\u0430\u0440\u0442\u0438\u044f \u0441\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u043e\u0432-\u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u043e\u043d\u0435\u0440\u043e\u0432\">\u044d\u0441\u0435\u0440\u043e\u043c<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%B3%D1%80%D0%BE%D0%B2,_%D0%94%D0%BC%D0%B8%D1%82%D1%80%D0%B8%D0%B9_%D0%93%D1%80%D0%B8%D0%B3%D0%BE%D1%80%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0411\u043e\u0433\u0440\u043e\u0432, \u0414\u043c\u0438\u0442\u0440\u0438\u0439 \u0413\u0440\u0438\u0433\u043e\u0440\u044c\u0435\u0432\u0438\u0447\">\u0414.&#160;\u0413.&#160;\u0411\u043e\u0433\u0440\u043e\u0432\u044b\u043c<\/a> \u0441\u043c\u0435\u0440\u0442\u0435\u043b\u044c\u043d\u043e \u0440\u0430\u043d\u0435\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%BE%D0%BB%D1%8B%D0%BF%D0%B8%D0%BD,_%D0%9F%D1%91%D1%82%D1%80_%D0%90%D1%80%D0%BA%D0%B0%D0%B4%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0421\u0442\u043e\u043b\u044b\u043f\u0438\u043d, \u041f\u0451\u0442\u0440 \u0410\u0440\u043a\u0430\u0434\u044c\u0435\u0432\u0438\u0447\">\u041f\u0451\u0442\u0440 \u0410\u0440\u043a\u0430\u0434\u044c\u0435\u0432\u0438\u0447 \u0421\u0442\u043e\u043b\u044b\u043f\u0438\u043d<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439<\/a> \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0434\u0435\u044f\u0442\u0435\u043b\u044c, \u043c\u0438\u043d\u0438\u0441\u0442\u0440 \u0432\u043d\u0443\u0442\u0440\u0435\u043d\u043d\u0438\u0445 \u0434\u0435\u043b, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%BC%D1%8C%D0%B5%D1%80-%D0%BC%D0%B8%D0%BD%D0%B8%D1%81%D1%82%D1%80%D1%8B_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8\" class=\"mw-redirect\" title=\"\u041f\u0440\u0435\u043c\u044c\u0435\u0440-\u043c\u0438\u043d\u0438\u0441\u0442\u0440\u044b \u0420\u043e\u0441\u0441\u0438\u0438\">\u043f\u0440\u0435\u043c\u044c\u0435\u0440-\u043c\u0438\u043d\u0438\u0441\u0442\u0440 \u0420\u043e\u0441\u0441\u0438\u0438<\/a> (\u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1906_%D0%B3%D0%BE%D0%B4\" title=\"1906 \u0433\u043e\u0434\">1906 \u0433\u043e\u0434\u0430<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1917_%D0%B3%D0%BE%D0%B4\" title=\"1917 \u0433\u043e\u0434\">1917<\/a>&#160;\u2014 \u041e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u043e\u0435 \u0441\u0432\u0435\u0440\u0436\u0435\u043d\u0438\u0435 \u043c\u043e\u043d\u0430\u0440\u0445\u0438\u0438: <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%80%D0%B5%D0%BC%D0%B5%D0%BD%D0%BD%D0%BE%D0%B5_%D0%BF%D1%80%D0%B0%D0%B2%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D1%81%D1%82%D0%B2%D0%BE_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8\" title=\"\u0412\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0435 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u0420\u043e\u0441\u0441\u0438\u0438\">\u0412\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0435 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e<\/a> \u043e\u0431\u044a\u044f\u0432\u0438\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u044e<\/a> \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1927_%D0%B3%D0%BE%D0%B4\" title=\"1927 \u0433\u043e\u0434\">1927<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D1%86%D1%86%D0%B0\" title=\"\u041d\u0438\u0446\u0446\u0430\">\u041d\u0438\u0446\u0446\u0435<\/a> \u0438\u0437-\u0437\u0430 \u0442\u043e\u0433\u043e, \u0447\u0442\u043e \u0448\u0430\u0440\u0444 \u043d\u0430\u043c\u043e\u0442\u0430\u043b\u0441\u044f \u043d\u0430 \u043a\u043e\u043b\u0435\u0441\u043e \u0430\u0432\u0442\u043e\u043c\u043e\u0431\u0438\u043b\u044f, \u043f\u043e\u0433\u0438\u0431\u043b\u0430 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0442\u0430\u043d\u0446\u043e\u0432\u0449\u0438\u0446\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D1%83%D0%BD%D0%BA%D0%B0%D0%BD,_%D0%90%D0%B9%D1%81%D0%B5%D0%B4%D0%BE%D1%80%D0%B0\" title=\"\u0414\u0443\u043d\u043a\u0430\u043d, \u0410\u0439\u0441\u0435\u0434\u043e\u0440\u0430\">\u0410\u0439\u0441\u0435\u0434\u043e\u0440\u0430 \u0414\u0443\u043d\u043a\u0430\u043d<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1929_%D0%B3%D0%BE%D0%B4\" title=\"1929 \u0433\u043e\u0434\">1929<\/a>&#160;\u2014 \u0424\u0443\u0442\u0431\u043e\u043b\u0438\u0441\u0442\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B8%D0%BD%D0%B0%D0%BC%D0%BE_(%D1%84%D1%83%D1%82%D0%B1%D0%BE%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%BA%D0%BB%D1%83%D0%B1,_%D0%9A%D0%B8%D0%B5%D0%B2)\" title=\"\u0414\u0438\u043d\u0430\u043c\u043e (\u0444\u0443\u0442\u0431\u043e\u043b\u044c\u043d\u044b\u0439 \u043a\u043b\u0443\u0431, \u041a\u0438\u0435\u0432)\">\u043a\u0438\u0435\u0432\u0441\u043a\u043e\u0433\u043e \u00ab\u0414\u0438\u043d\u0430\u043c\u043e\u00bb<\/a> \u043f\u0440\u043e\u0432\u0435\u043b\u0438 \u0441\u0432\u043e\u0439 \u043f\u0435\u0440\u0432\u044b\u0439 \u043c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0439 \u043c\u0430\u0442\u0447 (\u0441\u043e \u0441\u0431\u043e\u0440\u043d\u043e\u0439 \u0440\u0430\u0431\u043e\u0447\u0438\u0445 \u041d\u0438\u0436\u043d\u0435\u0439 \u0410\u0432\u0441\u0442\u0440\u0438\u0438).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1937_%D0%B3%D0%BE%D0%B4\" title=\"1937 \u0433\u043e\u0434\">1937<\/a>&#160;\u2014 \u0417\u0430\u0432\u0435\u0440\u0448\u0435\u043d\u0438\u0435 \u041d\u0438\u043e\u043d\u0441\u043a\u043e\u0439 \u043a\u043e\u043d\u0444\u0435\u0440\u0435\u043d\u0446\u0438\u0438 \u043f\u043e \u043f\u043e\u0432\u043e\u0434\u0443 \u0441\u043b\u043e\u0436\u0438\u0432\u0448\u0435\u0439\u0441\u044f \u0441\u0438\u0442\u0443\u0430\u0446\u0438\u0438 \u0432 \u0418\u0441\u043f\u0430\u043d\u0438\u0438 .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1939_%D0%B3%D0%BE%D0%B4\" title=\"1939 \u0433\u043e\u0434\">1939<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> \u0432 \u0432\u043e\u0437\u0434\u0443\u0445 \u043f\u043e\u0434\u043d\u044f\u043b\u0441\u044f \u043f\u0435\u0440\u0432\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D1%80%D1%82%D0%BE%D0%BB%D1%91%D1%82\" title=\"\u0412\u0435\u0440\u0442\u043e\u043b\u0451\u0442\">\u0432\u0435\u0440\u0442\u043e\u043b\u0451\u0442<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D0%BA%D0%BE%D1%80%D1%81%D0%BA%D0%B8%D0%B9,_%D0%98%D0%B3%D0%BE%D1%80%D1%8C_%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0421\u0438\u043a\u043e\u0440\u0441\u043a\u0438\u0439, \u0418\u0433\u043e\u0440\u044c \u0418\u0432\u0430\u043d\u043e\u0432\u0438\u0447\">\u0418.&#160;\u0418.&#160;\u0421\u0438\u043a\u043e\u0440\u0441\u043a\u043e\u0433\u043e<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Vought-Sikorsky_300\" title=\"Vought-Sikorsky 300\">VS-300<\/a>.<\/li><li>1940&#160;\u2014 \u043d\u0430\u0447\u0430\u043b\u043e 15 \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u0418\u043d\u0434\u0438\u043a\u0442\u0438\u043e\u043d\u0430 (\u0418\u043d\u0434\u0438\u043a\u0442\u0438\u043e\u043d&#160;\u2014 \u043f\u0435\u0440\u0438\u043e\u0434 \u0432\u0440\u0435\u043c\u0435\u043d\u0438 \u0432 532 \u0433\u043e\u0434\u0430, \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u043c\u044b\u0439 \u0432\u0435\u043b\u0438\u043a\u0438\u043c \u043f\u0430\u0441\u0445\u0430\u043b\u044c\u043d\u044b\u043c \u043a\u0440\u0443\u0433\u043e\u043c, \u043f\u043e \u0438\u0441\u0442\u0435\u0447\u0435\u043d\u0438\u0438 \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u0434\u0430\u0442\u044b \u043f\u0440\u0430\u0437\u0434\u043d\u043e\u0432\u0430\u043d\u0438\u044f \u041f\u0430\u0441\u0445\u0438 \u0441\u043b\u0435\u0434\u0443\u044e\u0442 \u0432 \u0442\u043e\u043c \u0436\u0435 \u043f\u043e\u0440\u044f\u0434\u043a\u0435, \u043a\u0430\u043a \u0432 \u043f\u0440\u0435\u0434\u0448\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u0432\u0448\u0438\u0439 \u043f\u0435\u0440\u0438\u043e\u0434.)<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1942_%D0%B3%D0%BE%D0%B4\" title=\"1942 \u0433\u043e\u0434\">1942<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D0%B0\" title=\"\u041a\u0430\u043d\u0430\u0434\u0430\">\u043a\u0430\u043d\u0430\u0434\u0441\u043a\u0438\u0439<\/a> \u044d\u0441\u043a\u0430\u0434\u0440\u0435\u043d\u043d\u044b\u0439 \u043c\u0438\u043d\u043e\u043d\u043e\u0441\u0435\u0446 \u00abOttawa\u00bb \u0431\u044b\u043b \u0442\u043e\u0440\u043f\u0435\u0434\u0438\u0440\u043e\u0432\u0430\u043d \u043f\u043e\u0434\u0432\u043e\u0434\u043d\u043e\u0439 \u043b\u043e\u0434\u043a\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/U-91_(1941)\" title=\"U-91 (1941)\">U-91<\/a> \u0432 \u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0439 \u0410\u0442\u043b\u0430\u043d\u0442\u0438\u043a\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1947_%D0%B3%D0%BE%D0%B4\" title=\"1947 \u0433\u043e\u0434\">1947<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B3%D0%BE%D1%84\" title=\"\u041f\u0435\u0442\u0435\u0440\u0433\u043e\u0444\">\u041f\u0435\u0442\u0440\u043e\u0434\u0432\u043e\u0440\u0446\u0435<\/a> \u043f\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%BD%D0%B8%D0%BD%D0%B3%D1%80%D0%B0%D0%B4\" class=\"mw-redirect\" title=\"\u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\">\u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u043e\u043c<\/a> \u0432\u043d\u043e\u0432\u044c \u043e\u0442\u043a\u0440\u044b\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BC%D1%81%D0%BE%D0%BD_(%D1%84%D0%BE%D0%BD%D1%82%D0%B0%D0%BD,_%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B3%D0%BE%D1%84)\" title=\"\u0421\u0430\u043c\u0441\u043e\u043d (\u0444\u043e\u043d\u0442\u0430\u043d, \u041f\u0435\u0442\u0435\u0440\u0433\u043e\u0444)\">\u0444\u043e\u043d\u0442\u0430\u043d \u00ab\u0421\u0430\u043c\u0441\u043e\u043d\u00bb<\/a>, \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u044b\u0439 \u043f\u043e\u0441\u043b\u0435 \u043d\u0435\u043c\u0435\u0446\u043a\u043e\u0439 \u043e\u043a\u043a\u0443\u043f\u0430\u0446\u0438\u0438 \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%B0%D1%8F_%D0%9E%D1%82%D0%B5%D1%87%D0%B5%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0412\u0435\u043b\u0438\u043a\u0430\u044f \u041e\u0442\u0435\u0447\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0412\u0435\u043b\u0438\u043a\u043e\u0439 \u041e\u0442\u0435\u0447\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1954_%D0%B3%D0%BE%D0%B4\" title=\"1954 \u0433\u043e\u0434\">1954<\/a>&#160;\u2014 \u041d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%BE%D1%86%D0%BA%D0%B8%D0%B9_%D0%BF%D0%BE%D0%BB%D0%B8%D0%B3%D0%BE%D0%BD\" title=\"\u0422\u043e\u0446\u043a\u0438\u0439 \u043f\u043e\u043b\u0438\u0433\u043e\u043d\">\u0422\u043e\u0446\u043a\u043e\u043c \u043f\u043e\u043b\u0438\u0433\u043e\u043d\u0435<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%80%D0%B5%D0%BD%D0%B1%D1%83%D1%80%D0%B3%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C\" title=\"\u041e\u0440\u0435\u043d\u0431\u0443\u0440\u0433\u0441\u043a\u0430\u044f \u043e\u0431\u043b\u0430\u0441\u0442\u044c\">\u041e\u0440\u0435\u043d\u0431\u0443\u0440\u0433\u0441\u043a\u0430\u044f \u043e\u0431\u043b\u0430\u0441\u0442\u044c<\/a>) \u043f\u0440\u043e\u0432\u0435\u0434\u0435\u043d\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%BE%D1%86%D0%BA%D0%B8%D0%B5_%D0%B2%D0%BE%D0%B9%D1%81%D0%BA%D0%BE%D0%B2%D1%8B%D0%B5_%D1%83%D1%87%D0%B5%D0%BD%D0%B8%D1%8F\" title=\"\u0422\u043e\u0446\u043a\u0438\u0435 \u0432\u043e\u0439\u0441\u043a\u043e\u0432\u044b\u0435 \u0443\u0447\u0435\u043d\u0438\u044f\">\u0432\u043e\u0439\u0441\u043a\u043e\u0432\u044b\u0435 \u0443\u0447\u0435\u043d\u0438\u044f<\/a> \u0432 \u0443\u0441\u043b\u043e\u0432\u0438\u044f\u0445 \u0440\u0435\u0430\u043b\u044c\u043d\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%B4%D0%B5%D1%80%D0%BD%D0%BE%D0%B5_%D0%BE%D1%80%D1%83%D0%B6%D0%B8%D0%B5\" title=\"\u042f\u0434\u0435\u0440\u043d\u043e\u0435 \u043e\u0440\u0443\u0436\u0438\u0435\">\u044f\u0434\u0435\u0440\u043d\u043e\u0433\u043e \u0432\u0437\u0440\u044b\u0432\u0430<\/a> \u0441 \u0443\u0447\u0430\u0441\u0442\u0438\u0435\u043c \u0434\u043e 45 \u0442\u044b\u0441\u044f\u0447 \u0432\u043e\u0435\u043d\u043d\u043e\u0441\u043b\u0443\u0436\u0430\u0449\u0438\u0445 \u0432\u0441\u0435\u0445 \u0432\u0438\u0434\u043e\u0432 \u0438 \u0440\u043e\u0434\u043e\u0432 \u0432\u043e\u0439\u0441\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1957_%D0%B3%D0%BE%D0%B4\" title=\"1957 \u0433\u043e\u0434\">1957<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%80%D0%B3%D0%B0%D0%BD%D0%B8%D0%B7%D0%B0%D1%86%D0%B8%D1%8F_%D0%9E%D0%B1%D1%8A%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D1%85_%D0%9D%D0%B0%D1%86%D0%B8%D0%B9\" title=\"\u041e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f \u041e\u0431\u044a\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0445 \u041d\u0430\u0446\u0438\u0439\">\u041e\u041e\u041d<\/a> \u043e\u0441\u0443\u0434\u0438\u043b\u0430 \u0432\u0432\u043e\u0434 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0445 \u0432\u043e\u0439\u0441\u043a \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BD%D0%B3%D1%80%D0%B8%D1%8F\" title=\"\u0412\u04