10\u043c\u0435\u0440\u0438\u043a\u0430<\/a>\u00bb \u0440\u0430\u0437\u0440\u0435\u0448\u0438\u043b\u0438 \u0443\u0447\u0430\u0441\u0442\u0432\u043e\u0432\u0430\u0442\u044c \u0432 \u043d\u0451\u043c \u0440\u0430\u0437\u0432\u0435\u0434\u0451\u043d\u043d\u044b\u043c \u0436\u0435\u043d\u0449\u0438\u043d\u0430\u043c \u0438 \u0442\u0435\u043c, \u043a\u0442\u043e \u0434\u0435\u043b\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B1%D0%BE%D1%80%D1%82\" title=\"\u0410\u0431\u043e\u0440\u0442\">\u0430\u0431\u043e\u0440\u0442\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2000_%D0%B3%D0%BE%D0%B4\" title=\"2000 \u0433\u043e\u0434\">2000<\/a>&#160;\u2014 \u041a\u043e\u0440\u043f\u043e\u0440\u0430\u0446\u0438\u044f \u041c\u0430\u0439\u043a\u0440\u043e\u0441\u043e\u0444\u0442 \u0432\u044b\u043f\u0443\u0441\u0442\u0438\u043b\u0430 \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u043e\u043d\u043d\u0443\u044e \u0441\u0438\u0441\u0442\u0435\u043c\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Windows_ME\" title=\"Windows ME\">Windows Milennium Edition<\/a><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2002_%D0%B3%D0%BE%D0%B4\" title=\"2002 \u0433\u043e\u0434\">2002<\/a><ul><li>\u0418\u0441\u043f\u043e\u043b\u043d\u0438\u043b\u043e\u0441\u044c 225 \u043b\u0435\u0442 \u0433\u043e\u0440\u043e\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%B0%D0%B2%D1%80%D0%BE%D0%BF%D0%BE%D0%BB%D1%8C\" title=\"\u0421\u0442\u0430\u0432\u0440\u043e\u043f\u043e\u043b\u044c\">\u0421\u0442\u0430\u0432\u0440\u043e\u043f\u043e\u043b\u044e<\/a>. \u0412 \u0447\u0435\u0441\u0442\u044c \u044d\u0442\u043e\u0439 \u0434\u0430\u0442\u044b \u0432 \u0433\u043e\u0440\u043e\u0434\u0435 \u0431\u044b\u043b\u0430 \u043e\u0442\u043a\u0440\u044b\u0442\u0430 25-\u043c\u0435\u0442\u0440\u043e\u0432\u0430\u044f \u0441\u0442\u0435\u043b\u0430, \u0443\u0432\u0435\u043d\u0447\u0430\u043d\u043d\u0430\u044f 7-\u043c\u0435\u0442\u0440\u043e\u0432\u043e\u0439 \u0444\u0438\